create table reservemask_tenant_record
(
    id                BIGINT(19) auto_increment
        primary key,
    tenant            VARCHAR(255)  null comment '租客',
    tenant_phone      VARCHAR(255)  null comment '租客电话',
    tenant_idcard     VARCHAR(255)  null comment '租客身份证号',
    tenant_idcard_img VARCHAR(2000) null comment '身份证图片地址',
    owner_id          BIGINT(19)    null comment '房东id',
    create_time       BIGINT(19)    null,
    update_time       BIGINT(19)    null,
    constraint reservemask_tenant_record_ibfk_1
        foreign key (owner_id) references reservemask_owner_record (id)
)
    collate = utf8mb4_unicode_ci;

create index fk_owner_id
    on reservemask_tenant_record (owner_id);

